Sentencing hearing proceeded. Statements made as to sentencing.

As to COUNT 1-
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 36 MONTHS, with credit for 102 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 18 MONTHS.  

Defendant is eligible for the Challenge Incarceration Program. The defendant is eligible for the Substance Abuse Program.

Court STAYED the sentence and placed defendant on probation for 36 MONTHS with the following conditions:
1) No contact with Luis G. or Heather B.;
2) Pay restitution in the amount of $2,800.00 to Luis G. as requested in case 15CM1756. Restitution to be paid FIRST before costs, fees and surcharges;
3) Pay all costs, fees, surcharges and restitution during period of probation. Failure to pay will result in a civil judgment;
4) Provide DNA sample and pay DNA surcharge;
5) Mental health evaluation;
6) Comply with any medication regimens as ordered;
7) Provide agent with a list of medications being taken;
8) No use of controlled substances or alcohol;

It is the Court's intention the defendant receive credit for this case as well as the case pending in Eau Claire County 15CF559.

Court costs, fees, surcharges and restitution be paid through collection by the department of Corrections from 25% of funds and earnings.

It is the Court's intention the conditions of probation be the same conditions of extended supervision if revoked. 

Appellate rights notice given to the defendant. 
Filed;
Written Explanation of Determinate Sentence;
Notice of Right to Seek Postconviction Relief;
signed Ineligible Voting Notice & Acknowledgement;
Pretrial Incarceration Credit (2).

Arguments heard as to bail. Court ordered cash bail be set in the amount of $200.00 with turnover to Justice Point monitoring with the following conditions:
- Maintain absolute sobriety;
-Random urine screens.
